import React from "react";
import { Link, Redirect } from "react-router-dom";
import { connect } from "react-redux";
import * as actions from "../store/actions/index";

const PlanCard = (props) => {

   return (
     <li className='col span-1-of-3'>
       <div className='product-card'>
         <div className='col product-outer'>
           <div className='product-photo'>

           </div>
           <React.Fragment>
             <ul className='product-card-details'>
               <li className='product-title'>
                 <li>plan</li>
               </li>

               <li className='product-subtitle'>
                 <li>plan info</li>
               </li>
             </ul>
           </React.Fragment>
         </div>
       </div>
     </li>
   );
}

const mapDispatchToProps = (dispatch) => {
  return {
    userPlanStart: (user_id, plan_id) => dispatch(actions.userPlanStart(user_id, plan_id))
  }
}

export default connect(null, mapDispatchToProps)(PlanCard)
